import React from 'react'

export const UserData = () => {
  const formData = JSON.parse(localStorage.getItem('formData'));

  return (
    <div className="bg-white rounded-lg p-6 shadow-md">
      <div className="flex items-center justify-center mb-6">
        <img src="https://via.placeholder.com/150" alt="Placeholder" className="rounded-full w-32 h-32 border-4 border-blue-500" />
      </div>
      <div className="text-center">
        <h3 className="text-2xl font-semibold mb-2">{formData.name}</h3>
        <p className="text-gray-600 text-lg mb-2">{formData.email}</p>
        <p className="text-gray-600 mb-2"><span className="font-semibold">Mobile Number:</span> {formData.mobileNumber}</p>
        <p className="text-gray-600 mb-2"><span className="font-semibold">Date of Birth:</span> {formData.dateOfBirth}</p>
      </div>
    </div>

  );
}
